import React from "react";

const GreenEnergyProviderPage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex justify-center items-center">
      <div className="bg-white p-10 rounded-xl shadow-lg w-full max-w-2xl">
        <h2 className="text-3xl font-bold text-green-600 mb-6">Green Energy Provider Dashboard</h2>
        <p className="text-lg text-gray-700 mb-6">Welcome to your dashboard. Manage your green energy solutions here.</p>
        <div className="space-y-4">
          <button className="w-full py-3 bg-green-600 text-white rounded-lg hover:bg-green-700 transition">
            View Available Energy Solutions
          </button>
          <button className="w-full py-3 bg-gray-800 text-white rounded-lg hover:bg-gray-700 transition">
            Manage Your Profile
          </button>
        </div>
      </div>
    </div>
  );
};

export default GreenEnergyProviderPage;
